    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Seney NWR for the next 15 years. This plan outlines
    the Refuge vision and purpose and describes how Seney NWR will contribute to the
    overall mission of the Refuge System. The plan provides an introduction to the Refuge,
    an overview of the CCP process, information about the environment, information about
    the management direction, and strategies for implementation. Key planning issues
    include: habitat management, aquatic resources, wildlife management, and visitor
